import React, { Component } from 'react'
import Search from '../../components/Search/Search'
import Checkbox from '../../components/Checkbox/Checkbox'
import './SelectItems.css'

class SelectItems extends Component {
    constructor(props){
        super(props)
    }

    render() {
        return (
            <main className="select-items">
                <h1>O que você quer transportar?</h1>
                <Search placeholder="Buscar itens"/>
                <section className="items-selected">
                    <p>Você ainda não adicionou nada na sua lista</p>
                </section>
                <section className="choose-items">
                    <Checkbox/>
                </section>
            </main>
        )
    }
}

export default SelectItems
